def get_max_profit(stock_prices):
    _max = 0
    for i in range(len(stock_prices)):
        for j in range(i, len(stock_prices)):
            if _max < stock_prices[j] - stock_prices[i]:
                _max = stock_prices[j] - stock_prices[i]
    return _max


def max_prof():
    _max_p = 0
    min_first = stock_prices[0]

    for i in range(len(stock_prices)):
        if stock_prices[i] < min_first :
            min_first = stock_prices[i]
        if _max_p < stock_prices[i] - min_first:
            _max_p = stock_prices[i] - min_first
    return _max_p


