def merge_lists(my_list, alices_list):
    new_list = []
    i = 0  # my
    j = 0  # alice

    while True:
        if j == len(alices_list) and i == len(my_list):
            return new_list
        elif i < len(my_list) and (j == len(alices_list) or my_list[i] < alices_list[j]):
            new_list.append(my_list[i])
            i += 1
        else:
            new_list.append(alices_list[j])
            j += 1


